import Link from 'next/link';
import AppLayout from '../components/AppLayout';

const Home = () => {
  return (
    <>
      <AppLayout>
        <Link href="/about">
          <a>about</a>
        </Link>
      </AppLayout>
      <div>Hello, Next</div>
    </>
  );
};

export default Home;
